'''),
    "design" : MessageLookupByLibrary.simpleMessage('''O Design Para Glasgow Necropolis
'''),
    "designText1" : MessageLookupByLibrary.simpleMessage('''Em 1831, John Strang, Chamberlain da Casa dos Mercadores, escreveu "Necropolis Glasguensis", ou "Pensamentos sobre a morte e o estímulo moral" e comentou:
'''),
    "designTextItalics" : MessageLookupByLibrary.simpleMessage('''“O Fir Park parece admiravelmente adaptado para um Pere la Chaise, que se harmonizaria lindamente com o cenário adjacente, e constituiria um apêndice solene e apropriado à venerável estrutura (a Catedral) em frente à qual, enquanto proporcionará uma acomodação muito procurada para as classes mais altas, converteria ao mesmo tempo uma propriedade improdutiva em uma fonte geral e lucrativa de lucro, em uma instituição de caridade ”, seria“ respeitoso com os mortos, seguro e sanitário para os vivos, dedicado ao gênio da Memória e estender o sentimento religioso e moral. ”
'''),
    "designText2" : MessageLookupByLibrary.simpleMessage('''A Casa dos Comerciantes pediu ao arquiteto David Hamilton, Stuart Murray, Curador do Jardim Botânico, e James Clelland, Superintendente de Obras Públicas, que produzissem um estudo de viabilidade para a formação da necrópole de Glasgow e, em 1828, o comitê de diretores de terras e pedreiras concordou em a proposta. Em 1831, um concurso para converter o Fir Park em um cemitério com 5 prêmios de 10 a 50 libras foi anunciado nos jornais. Dezesseis planos foram recebidos e expostos nas salas de exposições da Sociedade Diletante em Argyll Arcade. David Bryce, de Edimburgo, ganhou o primeiro prêmio e seu irmão John Bryce, de Glasgow, o segundo. Os juízes decidiram, no entanto, que o trabalho seria melhor realizado por um jardineiro. Como resultado, George Mylne foi nomeado superintendente e jardineiro e o trabalho começou.
'''),
    "victorian" : MessageLookupByLibrary.simpleMessage('''O Victorian Glasgow Necropolis
'''),
    "victorianText" : MessageLookupByLibrary.simpleMessage('''Tseu cemitério sempre teve a intenção de ser interdenominacional e o primeiro enterro em 1832 foi o de um judeu, Joseph Levi, um joalheiro. Em 1833, o primeiro enterro cristão foi de Elizabeth Miles, madrasta do superintendente George Mylne. Depois de 1860, as primeiras extensões leste e sul deveriam ocupar a pedreira de Ladywell e, em 1877 e 1892/3, foram construídas as extensões finais para o norte e sudeste, dobrando o tamanho do cemitério. A Necrópole agora tem 15 hectares.
                 
50.000 enterros foram realizados na Necrópole e a maioria dos 3.500 túmulos foram construídos com até 4 metros de profundidade, com paredes de pedra e paredes de tijolos. No topo das tumbas da necrópole foram explodidas as rochas. Em 1877, o Molendinar Burn, correndo sob a Ponte dos Suspiros, foi atingido. Esta queimadura na qual se dizia que St. Mungo pescava salmão está agora no subsolo, a caminho de Clyde.
                 
A Necrópole foi um dos poucos cemitérios a manter registros dos mortos, incluindo profissão, idade, sexo e causa da morte. Em julho de 1878, o livro de visitantes mostra que 13.733 pessoas visitaram a necrópole de Glasgow - 12.400 cidadãos e 1.333 outros visitantes.
                 
Em 1966, a Casa dos Comerciantes entregou a Necrópole ao Conselho da Cidade de Glasgow, que agora a administra e mantém. Os bancos e as cercas foram removidos e a maior parte da área foi plantada para fins de manutenção. Existem monumentos aqui projetados pelos principais arquitetos e escultores da época, incluindo Alexander 'Greek' Thomson, Charles Rennie Macintosh e JT Rochead, em todos os estilos arquitetônicos, criados para os empresários proeminentes e ricos da 'Segunda Cidade do Império'.
                 
A necrópole de Glasgow ainda tem uma atmosfera maravilhosa e ainda atrai muitos visitantes localmente e de todo o mundo.'''),
